import { Link } from "react-router-dom";
import './game.css';

const GameGrid = () => {
    let cases = [...document.getElementsByClassName('case')];

    let player1 = document.getElementById('one');
    let player2 = document.getElementById('two');

    let state = {
        player: 1,
        c1: 0,
        c2: 0,
        c3: 0,
        c4: 0,
        c5: 0,
        c6: 0,
        c7: 0,
        c8: 0,
        c9: 0,
    }

    const alert = () => {
        
    }

    const resetState = () => {
        state.player = 1;
        state.c1 = 0;
        state.c2 = 0;
        state.c3 = 0;
        state.c4 = 0;
        state.c5 = 0;
        state.c6 = 0;
        state.c7 = 0;
        state.c8 = 0;
        state.c9 = 0;
    }

    function reset() {
        cases.forEach(async (c) => {
            c.textContent = "";
        })
    }

    const checkVictory = () => {
        if(
            (state.c1 === state.c2 && state.c2 === state.c3 && state.c1 > 0) || 
            (state.c1 === state.c4 && state.c4 === state.c7 && state.c1 > 0) ||
            (state.c1 === state.c5 && state.c5 === state.c9 && state.c1 > 0) ||
            (state.c2 === state.c5 && state.c5 === state.c8 && state.c2 > 0) ||
            (state.c3 === state.c6 && state.c6 === state.c9 && state.c3 > 0) ||
            (state.c4 === state.c5 && state.c5 === state.c6 && state.c4 > 0) ||
            (state.c7 === state.c8 && state.c8 === state.c9 && state.c7 > 0) 
        ) {
            return true;
        } else if(
            state.c1 !== 0 &&
            state.c2 !== 0 &&
            state.c3 !== 0 &&
            state.c4 !== 0 &&
            state.c5 !== 0 &&
            state.c6 !== 0 &&
            state.c7 !== 0 &&
            state.c8 !== 0 &&
            state.c9 !== 0
        ) {
            return null;
        } else {
            return false;
        }
    }

    const playCases = (e) => {
        let idCase = e.target.id;
        if(state[idCase] !== 0) return;

        state[idCase] = state.player;

        let isVictory = checkVictory();
        if(isVictory === true) {
            resetState();
            cases.forEach(async (c) => {
                c.textContent = "";
            })

            let popup = document.getElementsByClassName('boxDescription');
            popup.style.display = 'block';
        } else if(isVictory === null) {
            resetState();
            cases.forEach(async (c) => {
                c.textContent = "";
            })
        } else if(isVictory === false) {
            if(state.player === 1) {
                e.target.textContent = 'x';
                state.player = 2;

                player2.style.color = "black";
                player2.style.border = "solid 1px black";

                player1.style.color = "rgb(98, 205, 255)";
                player1.style.border = "none";
            } else {
                e.target.textContent = 'o';
                state.player = 1;

                player1.style.color = "black";
                player1.style.border = "solid 1px black";

                player2.style.color = "rgb(250, 60, 60)";
                player2.style.border = "none";
            }
        } 
    }

    cases.forEach(async (element) => {
        element.addEventListener('click', playCases);
    })

    return(
        <div className=''>
            <div className='players'>
                <div className='player-1' id='one'>
                    <a className='playerText'>Vous</a>
                </div>
                <div className='player-2' id='two'>
                    <a className='playerText'>Ordinateur</a>
                </div>
            </div>
            <div className='grid'>
                <div id='c1' className='case'></div>
                <div id='c2' className='case'></div>
                <div id='c3' className='case'></div>
                <div id='c4' className='case'></div>
                <div id='c5' className='case'></div>
                <div id='c6' className='case'></div>
                <div id='c7' className='case'></div>
                <div id='c8' className='case'></div>
                <div id='c9' className='case'></div>
            </div>
            <div className='bottom'>
                <a className='timer' id='time'>DÃ©but de partie !</a>
            </div>
            <div className='alertBox' id='alert'>
                <a className='boxTitle'>Partie terminÃ©e ! ðŸŽ‰</a>
                <p className='boxDescription'></p>
                <button className='boxReset' onClick={reset()}>Accueil</button>
            </div>
        </div>
    )
}


export default GameGrid;
